import React from "react";
import "./Product.css";

function Product() {
  return (
    <div className="product">
      <div className="product__info">
        <p>The Lean Startup</p>
        <p className="product__price">
          <small>Rs.</small>
          <strong>1200</strong>
        </p>
      </div>
    </div>
  );
}

export default Product;
